import os, re
import numpy as np

dict = {}
cnt = 0

for root, dirs, files in os.walk("./symflower_related/tmp/"):
    dirs.sort()
    cnt += 1
    path = root.split(os.sep)
    print((len(path) - 1) * '---', os.path.basename(root))
    for file in files:
        print(len(path) * '---', file)
        if "Symflower" in file:
            filePath = os.path.join("./symflower_related/tmp/", os.path.basename(root), file)
            with open(filePath, 'r') as f:
                data = f.read().replace('\n', '')
                testCount = data.count("@Test")
                if os.path.basename(root) not in dict:
                    dict[os.path.basename(root)] = 0
                dict[os.path.basename(root)] += testCount
                if (re.findall(r"void (main)[0-9]+\(\)", data)):
                    dict[os.path.basename(root)] -= 1

print (dict)
print ("Number of codes that have test:", len(dict))
print ("Avg. number of tests per code:", np.array(list(dict.values())).mean())

